const Note = props => {
    return (
      <div
        onClick={event =>
          (props.noteObject.isCompleted = !props.noteObject.isCompleted)
        }
      >
        <span className={props.noteObject.isCompleted ? "done" : null}>
            {props.noteObject.note}
        </span>
        <br />
        {props.noteObject.isCompleted}
      </div>
    );
}

export default Note
